import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './componentes/Navbar.js';
import Titulo from './componentes/Titulo.js';
import Footer from './componentes/Footer.js';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Titulo />
          <Navbar />
          <nav className="navbar">
      <ul className="navbar-list">
        <li className="navbar-item"><Link to="/" className="navbar-link">Inicio</Link></li>
        <li className="navbar-item"><Link to="/acerca" className="navbar-link">Acerca</Link></li>
        <li className="navbar-item"><Link to="/contacto" className="navbar-link">Contacto</Link></li>
        <li className="navbar-item"><Link to="/catalogo" className="navbar-link">Catalogo</Link></li>
        <li className="navbar-item"><Link to="/login" className="navbar-link">Login</Link></li>
      </ul>
    </nav>
        </header>

        <main>
          <Routes>
            <Route path="/" element={<div>Inicio</div>} />
            <Route path="/acerca" element={<div>Acerca</div>} />
            <Route path="/contacto" element={<div>Contacto</div>} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
